import React, { useEffect, useState } from 'react';
import {Table} from './features/table/Table';
import './App.css';

function App() {
  const [sensors, setSensores] = useState(null);

  const fetchData = async ()=>{
    try{
      const response = await fetch('http://localhost:5000/listings');
      const SensorData = await response.json();
      setSensores(SensorData);
    }catch(e){
      console.log(e.stack);
    }
  }

  useEffect( ()=> {fetchData()},[]);

  const data = React.useMemo(
    () => [
      {
          "_id": "624b7b7f71865ddd2e212fe7",
          "timestamp_day": "2021-08-03T07:41:43.757Z",
          "name": "Dayana",
          "long": 103,
          "lat": 19,
          "temperature": 36,
          "humidity": 47,
          "pH": 7,
          "pressure": 26,
          "co2": 52
      },
      {
          "_id": "624b7b7f71865ddd2e212fe8",
          "timestamp_day": "2022-03-29T20:03:17.334Z",
          "name": "Kyla",
          "long": -129,
          "lat": 34,
          "temperature": 24,
          "humidity": 97,
          "pH": 0,
          "pressure": 28,
          "co2": 78
      }
  ],
    []
  )

  const columns = React.useMemo(
    () => [
      {
        Header: 'Id',
        accessor: '_id',
      },
      {
        Header: 'Timestamp',
        accessor: 'timestamp_day',
      },
      {
        Header: 'Name',
        accessor: 'name',
      },
      {
        Header: 'long',
        accessor: 'long',
      },
      {
        Header: 'lat',
        accessor: 'lat',
      },
      {
        Header: 'temperature',
        accessor: 'temperature',
      },
      {
        Header: 'humidity',
        accessor: 'humidity',
      },
      {
        Header: 'pH',
        accessor: 'pH',
      },
      {
        Header: 'pressure',
        accessor: 'pressure',
      },
      {
        Header: 'co2',
        accessor: 'co2',
      }
    ],
    []
  )

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        {/* <Counter /> */}
        <Table columns={columns} data={data}/>
        <div data = {sensors}></div>

      </header>
    </div>
  );
}

export default App;
